import React, {Component} from 'react'
import Calendar from '../../UI/Calendar/Calendar'
import classes from './Availability.module.css'

class Availability extends Component{
	state = {...this.props}

	render(){
		console.log(['Availability'], this.props.canvasser);
		let inavailable = this.state.canvasser? this.state.canvasser.inavailable :null 
		return (
			<div className={classes.Section}>
			<div className = {['row'].join(' ')}>
				<div className = {['col-3'].join(' ')}>
					<h2> Canvasser</h2>
					<h2> Availability</h2>
				</div>
			</div>

			<div className = {['row'].join(' ')}>
				<h1>Calendar</h1>
				<Calendar inavailable = {inavailable}/>
			</div>
			</div>
		);

	}
}

export default Availability
